import {
  Select,
  InputLabel,
  MenuItem,
  FormHelperText,
  FormControl,
  InputAdornment,
  Button,
} from "@mui/material";
import PropTypes from "prop-types";
import styles from "./FrameComponent7.css";

const FrameComponent7 = ({ className = "" }) => {
  return (
    <section className={[styles.swasthya14Inner, className].join(" ")}>
      <div className={styles.rectangleParent}>
        <div className={styles.frameChild} />
        <h1 className={styles.meetSpecialist}>MEET SPECIALIST</h1>
        <form className={styles.searchSpecialist}>
          <div className={styles.searchSpecialistChild} />
          <FormControl
            className={styles.parent}
            variant="standard"
            sx={{
              borderTopWidth: "1px",
              borderRightWidth: "1px",
              borderBottomWidth: "1px",
              borderLeftWidth: "1px",
              backgroundColor: "#fff",
              borderRadius: "40px",
              width: "40.02517306482064%",
              height: "62px",
              m: 0,
              p: 0,
              "& .MuiInputBase-root": {
                m: 0,
                p: 0,
                minHeight: "62px",
                justifyContent: "center",
                display: "inline-flex",
              },
              "& .MuiInputLabel-root": {
                m: 0,
                p: 0,
                minHeight: "62px",
                display: "inline-flex",
              },
              "& .MuiMenuItem-root": {
                m: 0,
                p: 0,
                height: "62px",
                display: "inline-flex",
              },
              "& .MuiSelect-select": {
                m: 0,
                p: 0,
                height: "62px",
                alignItems: "center",
                display: "inline-flex",
              },
              "& .MuiInput-input": { m: 0, p: 0 },
              "& .MuiInputBase-input": {
                color: "#403f3e",
                fontSize: 34,
                fontWeight: "Bold",
                fontFamily: "Inter",
                textAlign: "left",
                p: "0 !important",
                marginLeft: "30px",
              },
            }}
          >
            <InputLabel color="secondary" />
            <Select
              color="secondary"
              disableUnderline
              displayEmpty
              IconComponent={() => (
                <img
                  width="13.9px"
                  height="8.3px"
                  src="/polygon-3.svg"
                  style={{ marginRight: "30.1px" }}
                />
              )}
            >
              <MenuItem>Nursing</MenuItem>
            </Select>
            <FormHelperText />
          </FormControl>
          <div className={styles.rectangleGroup}>
            <div className={styles.frameItem} />
            <b className={styles.anand}>Anand</b>
          </div>
          <Button
            className={styles.searchSpecialistItem}
            disableElevation
            variant="contained"
            sx={{
              textTransform: "none",
              color: "#403f3e",
              fontSize: "32",
              background: "#fff",
              borderRadius: "35px",
              "&:hover": { background: "#fff" },
              width: 186,
              height: 62,
            }}
          >
            Search
          </Button>
        </form>
      </div>
    </section>
  );
};

FrameComponent7.propTypes = {
  className: PropTypes.string,
};

export default FrameComponent7;
